import { useEffect, useState } from "react";

const onRendering = () => {
  console.log("useeffect called");
};

function FetchApi() {
  useEffect(() => {
    onRendering();
  }, []);


  const [x,setx]=useState(0);

  
  return  ( <>
  This is just to  check useEffect hook
  <p> Value of x is : {x} </p>
  <button onClick={()=>setx(x+1)}>Increase</button>
  </>
);

}

export default FetchApi;
